INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(22, 'Buna User', '2019-07-03 11:11:43.463000', '2019-07-03 11:11:43.463000', 22, 2, 1, NULL, 0),
(24, 'Cu ce te pot ajuta?', '2019-07-03 11:11:43.487000', '2019-07-03 11:11:43.487000', 22, 2, 8, NULL, 0),
(23, 'Buna Oana', '2019-07-03 11:11:43.477000', '2019-07-03 11:11:43.477000', 22, 2, 1, NULL, 1),
(25, 'Ma doare rau capul', '2019-07-03 11:11:43.510000', '2019-07-03 11:11:43.510000', 22, 2, 9, NULL, 1),
(26, 'Buna, ma numesc <NAMEBOT>! Te pot ajuta cu ceva?', '2019-07-04 06:44:02.137812', '2019-07-04 06:44:02.137812', 23, 2, 1, NULL, 0),
(27, 'Buna <NAMEBOT>', '2019-07-04 06:44:02.146596', '2019-07-04 06:44:02.146596', 23, 2, 1, NULL, 1),
(28, 'Cum te simti azi, <NAME>?', '2019-07-04 06:44:02.158309', '2019-07-04 06:44:02.158309', 23, 2, 91, NULL, 0),
(29, 'Bine!', '2019-07-04 06:44:02.168069', '2019-07-04 06:44:02.168069', 23, 2, 2, NULL, 1),
(30, 'Am cu ce sa te ajut?', '2019-07-04 06:44:02.176852', '2019-07-04 06:44:02.176852', 23, 2, 91, NULL, 0),
(31, 'Da, am o intrebare.', '2019-07-04 06:44:02.187591', '2019-07-04 06:44:02.187591', 23, 2, 2, NULL, 1),
(32, 'Te ascult.', '2019-07-04 06:44:02.197349', '2019-07-04 06:44:02.197349', 23, 2, 91, NULL, 0),
(33, 'Ce sa fac daca nu am pofta de mancare?', '2019-07-04 06:44:02.206132', '2019-07-04 06:44:02.206132', 23, 2, 53, NULL, 1),
(34, 'Poti sa imi explici mai clar care este problema, te rog?', '2019-07-04 06:44:02.215894', '2019-07-04 06:44:02.215894', 23, 2, 91, NULL, 0),
(35, 'Ma simt slabit si nu pot sa mananc. Imi este greata daca incerc.', '2019-07-04 06:44:02.225653', '2019-07-04 06:44:02.225653', 23, 2, 53, NULL, 1),
(36, 'Am inteles. De cat timp ai problema asta?', '2019-07-04 06:44:02.235413', '2019-07-04 06:44:02.235413', 23, 2, 43, NULL, 0),
(37, 'De ieri seara.', '2019-07-04 06:44:02.245173', '2019-07-04 06:44:02.245173', 23, 2, 2, NULL, 1),
(38, 'Mai ai si alte simptome?', '2019-07-04 06:44:02.253958', '2019-07-04 06:44:02.253958', 23, 2, 43, NULL, 0),
(39, 'Nu, pur si simplu nu imi vine sa mananc.', '2019-07-04 06:44:02.263717', '2019-07-04 06:44:02.263717', 23, 2, 53, NULL, 1),
(40, 'Ai incercat sa vorbesti cu un medic pana acum?', '2019-07-04 06:44:02.273479', '2019-07-04 06:44:02.273479', 23, 2, 43, NULL, 0),
(41, 'Nu pentru ca nu as sti ce sa spun.', '2019-07-04 06:44:02.282261', '2019-07-04 06:44:02.282261', 23, 2, 2, NULL, 1),
(42, 'Inteleg. Ai un regim alimentar sanatos?', '2019-07-04 06:44:02.292021', '2019-07-04 06:44:02.292021', 23, 2, 20, NULL, 0),
(43, 'Da. Uneori ma mai duc la fast-food si mananc prajeli dar nu excesiv.', '2019-07-04 06:44:02.300805', '2019-07-04 06:44:02.300805', 23, 2, 53, NULL, 1),
(44, 'Te hidratezi suficient?', '2019-07-04 06:44:02.309589', '2019-07-04 06:44:02.309589', 23, 2, 43, NULL, 0),
(45, 'Da. Ce pot sa fac ca sa pot sa mananc?', '2019-07-04 06:44:02.319348', '2019-07-04 06:44:02.320325', 23, 2, 53, NULL, 1),
(46, 'Ti-as sugera sa consulti un medic generalist. De asemenea, mentine o dieta usoara si sanatoasa.', '2019-07-04 06:44:02.329109', '2019-07-04 06:44:02.329109', 23, 2, 36, NULL, 0),
(47, 'Am inteles. Multumesc.', '2019-07-04 06:44:02.338869', '2019-07-04 06:44:02.338869', 23, 2, 2, NULL, 1),
(48, 'Daca vrei, iti pot oferi un voucher pentru clinicaxxxxx unde poti face analize la un pret mai bun. Ce parere ai?', '2019-07-04 06:44:02.347653', '2019-07-04 06:44:02.347653', 23, 2, 11, NULL, 0),
(49, 'Mersi mult! Cum procedez cu voucher-ul?', '2019-07-04 06:44:02.356437', '2019-07-04 06:44:02.356437', 23, 2, 87, NULL, 1),
(50, 'Acesta este voucher-ul tau: voucherxxxxx . Informatii suplimentare legate de voucher sunt discutate in momentul programarii.', '2019-07-04 06:44:02.366197', '2019-07-04 06:44:02.366197', 23, 2, 50, NULL, 0),
(51, 'Multumesc', '2019-07-04 06:44:02.375957', '2019-07-04 06:44:02.375957', 23, 2, 2, NULL, 1),
