(684, 'Mi-au aparut niste puncte rosii', '2019-07-04 06:44:08.868303', '2019-07-04 06:44:08.868303', 52, 2, 64, NULL, 1),
(685, 'Imi pare rau, <NAME>. Imi poti da mai multe detalii, te rog?', '2019-07-04 06:44:08.878063', '2019-07-04 06:44:08.878063', 52, 2, 91, NULL, 0),
(686, 'Sunt puncte rosii, mi-au aparut pe piept si nu stiu de la ce.', '2019-07-04 06:44:08.887823', '2019-07-04 06:44:08.887823', 52, 2, 64, NULL, 1),
(687, 'De cat timp ai aceasta problema?', '2019-07-04 06:44:08.896607', '2019-07-04 06:44:08.896607', 52, 2, 43, NULL, 0),
(688, 'Azi dimineata le-am observat.', '2019-07-04 06:44:08.905391', '2019-07-04 06:44:08.905391', 52, 2, 2, NULL, 1),
(689, 'Ai alergie la ceva anume?', '2019-07-04 06:44:08.915151', '2019-07-04 06:44:08.915151', 52, 2, 59, NULL, 0),
(690, 'Doar la lactate. Am intoleranta la lactate, dar nu alergie. Deci nu cred ca am alergii mari.', '2019-07-04 06:44:08.923935', '2019-07-04 06:44:08.923935', 52, 2, 64, NULL, 1),
(691, 'Ai alte simptome?', '2019-07-04 06:44:08.932719', '2019-07-04 06:44:08.932719', 52, 2, 43, NULL, 0),
(692, 'Nu. Mi-e frica! Daca e ceva grav?', '2019-07-04 06:44:08.942479', '2019-07-04 06:44:08.942479', 52, 2, 2, NULL, 1),
(693, 'Te asigur ca indiferent ce este, te pot ajuta. Iti recomand urgent un consult medical la un dermatolog.', '2019-07-04 06:44:08.954192', '2019-07-04 06:44:08.954192', 52, 2, 47, NULL, 0),
(694, 'Sa ma dau cu unguent? Sa iau ceva?', '2019-07-04 06:44:08.968831', '2019-07-04 06:44:08.968831', 52, 2, 2, NULL, 1),
(695, 'Sunt sigura ca cei de la clinica te vor indruma mai departe.', '2019-07-04 06:44:08.986399', '2019-07-04 06:44:08.986399', 52, 2, 2, NULL, 0),
(696, 'Zi-mi tu ce sa iau!', '2019-07-04 06:44:08.999086', '2019-07-04 06:44:08.999086', 52, 2, 37, NULL, 1),
(697, 'Iti recomand o alimentatie echilibrata, un regim de viata sanatos si sa te hidratezi.', '2019-07-04 06:44:09.009823', '2019-07-04 06:44:09.009823', 52, 2, 55, NULL, 0),
(698, 'Dar medicamente ce pot sa iau?', '2019-07-04 06:44:09.022511', '2019-07-04 06:44:09.022511', 52, 2, 2, NULL, 1),
(699, 'Cred ca cel mai bine te poate indruma un medic.', '2019-07-04 06:44:09.035198', '2019-07-04 06:44:09.035198', 52, 2, 2, NULL, 0),
(700, 'Nu m-ai ajutat deloc!', '2019-07-04 06:44:09.045935', '2019-07-04 06:44:09.045935', 52, 2, 2, NULL, 1),
(701, 'Sa imi spui daca as putea ajuta cu altceva.', '2019-07-04 06:44:09.054719', '2019-07-04 06:44:09.054719', 52, 2, 72, NULL, 0),
(702, 'Cu nimic. pa!', '2019-07-04 06:44:09.063502', '2019-07-04 06:44:09.063502', 52, 2, 28, NULL, 1),
(703, 'La revedere!', '2019-07-04 06:44:09.074238', '2019-07-04 06:44:09.074238', 52, 2, 28, NULL, 0),
(704, 'Buna. Sunt <NAMEBOT>. Cu ce te pot ajuta?', '2019-07-04 06:44:09.102544', '2019-07-04 06:44:09.102544', 53, 2, 1, NULL, 0),
(705, 'Buna <NAMEBOT>. Am nevoie de ajutor!', '2019-07-04 06:44:09.112302', '2019-07-04 06:44:09.112302', 53, 2, 1, NULL, 1),
(706, 'Desigur, cu ce te pot ajuta, <NAME>?', '2019-07-04 06:44:09.124014', '2019-07-04 06:44:09.124014', 53, 2, 91, NULL, 0),
(707, 'Nu stiu cum sa explic. Simt asa ca o gheara in piept.', '2019-07-04 06:44:09.134751', '2019-07-04 06:44:09.134751', 53, 2, 67, NULL, 1),
(708, 'Inteleg. Iei tratament pentru asta?', '2019-07-04 06:44:09.142559', '2019-07-04 06:44:09.142559', 53, 2, 43, NULL, 0),
(709, 'Nu. Am baut ceai cald dar atat.', '2019-07-04 06:44:09.152318', '2019-07-04 06:44:09.152318', 53, 2, 2, NULL, 1),
(710, 'De cat timp ai aceasta problema?', '2019-07-04 06:44:09.165007', '2019-07-04 06:44:09.165007', 53, 2, 43, NULL, 0),
(711, 'De doua ore.', '2019-07-04 06:44:09.173791', '2019-07-04 06:44:09.173791', 53, 2, 2, NULL, 1),
(712, 'Alte simptome ai?', '2019-07-04 06:44:09.182575', '2019-07-04 06:44:09.182575', 53, 2, 43, NULL, 0),
(713, 'Simt furnicaturi pe bratul stang.', '2019-07-04 06:44:09.194287', '2019-07-04 06:44:09.194287', 53, 2, 2, NULL, 1),
(714, 'Poti sa imi explici care este problema mai clar, te rog?', '2019-07-04 06:44:09.204047', '2019-07-04 06:44:09.204047', 53, 2, 91, NULL, 0),
(715, 'Nu stiu! Ma strange inima si sunt agitat.', '2019-07-04 06:44:09.212833', '2019-07-04 06:44:09.212833', 53, 2, 67, NULL, 1),
(716, 'Ok, iti recomand o vizita medicala la clinicaxxxxx, sau solicita ambulanta la 112.', '2019-07-04 06:44:09.221615', '2019-07-04 06:44:09.221615', 53, 2, 84, NULL, 0),
(717, 'Si ce fac cu inima pana atunci?', '2019-07-04 06:44:09.230400', '2019-07-04 06:44:09.230400', 53, 2, 32, NULL, 1),
(718, 'Ramai calm si solicita ajutor de la un medic specializat.', '2019-07-04 06:44:09.239182', '2019-07-04 06:44:09.239182', 53, 2, 84, NULL, 0),
(719, 'Nu-mi poti recomanda un medicament?', '2019-07-04 06:44:09.247967', '2019-07-04 06:44:09.247967', 53, 2, 2, NULL, 1),
(720, 'Imi pare rau, pot doar sa recomand clinici medicale.', '2019-07-04 06:44:09.256751', '2019-07-04 06:44:09.256751', 53, 2, 2, NULL, 0),
(721, 'Nu ma ajuta.', '2019-07-04 06:44:09.266510', '2019-07-04 06:44:09.266510', 53, 2, 2, NULL, 1),
(722, 'Inteleg, dar in acest caz, numai un medic specialist te poate ajuta.', '2019-07-04 06:44:09.274318', '2019-07-04 06:44:09.274318', 53, 2, 2, NULL, 0),
(723, 'Crezi ca e un atac de cord?', '2019-07-04 06:44:09.283102', '2019-07-04 06:44:09.283102', 53, 2, 66, NULL, 1),
(724, 'Nu pot oferi diagnostic concret, insa recomand sa suni la 112 in cazul unei urgente medicale.', '2019-07-04 06:44:09.290910', '2019-07-04 06:44:09.290910', 53, 2, 44, NULL, 0),
(725, 'Nu vreau sa fac asta!', '2019-07-04 06:44:09.299694', '2019-07-04 06:44:09.299694', 53, 2, 2, NULL, 1),
(726, 'Cum doresti. Te mai pot ajuta cu ceva?', '2019-07-04 06:44:09.307502', '2019-07-04 06:44:09.307502', 53, 2, 72, NULL, 0),
(727, 'Nu. O sa ma descurc.', '2019-07-04 06:44:09.316287', '2019-07-04 06:44:09.316287', 53, 2, 26, NULL, 1),
(728, 'In regula.', '2019-07-04 06:44:09.325071', '2019-07-04 06:44:09.325071', 53, 2, 2, NULL, 0),
(729, 'La revedere <NAMEBOT>.', '2019-07-04 06:44:09.332878', '2019-07-04 06:44:09.332878', 53, 2, 28, NULL, 1),
(730, 'Iti urez o zi usoara, <NAME>.', '2019-07-04 06:44:09.341662', '2019-07-04 06:44:09.341662', 53, 2, 28, NULL, 0),
(731, 'Buna. Sunt <NAMEBOT>. Cu ce iti pot fi de folos azi?', '2019-07-04 06:44:09.357280', '2019-07-04 06:44:09.357280', 54, 2, 1, NULL, 0),
(732, 'Am o migrena infioratoare si nu mai stiu ce sa fac sa scap de ea.', '2019-07-04 06:44:09.366062', '2019-07-04 06:44:09.366062', 54, 2, 2, NULL, 1),
(733, 'Poti sa imi explici mai clar care este problema, te rog?', '2019-07-04 06:44:09.373870', '2019-07-04 06:44:09.373870', 54, 2, 91, NULL, 0),
(734, 'Ma doare capul foarte tare!', '2019-07-04 06:44:09.382655', '2019-07-04 06:44:09.382655', 54, 2, 52, NULL, 1),
(735, 'Inteleg. Iei medicamente pentru aceasta problema, <NAME>?', '2019-07-04 06:44:09.390462', '2019-07-04 06:44:09.390462', 54, 2, 43, NULL, 0),
(736, 'Am luat de toate.', '2019-07-04 06:44:09.399247', '2019-07-04 06:44:09.399247', 54, 2, 2, NULL, 1),
(737, 'Poti sa imi spui, te rog, daca esti sub tratament?', '2019-07-04 06:44:09.407054', '2019-07-04 06:44:09.407054', 54, 2, 43, NULL, 0),
(738, 'Nu am luat pastile. Am incercat sa dorm.', '2019-07-04 06:44:09.416815', '2019-07-04 06:44:09.416815', 54, 2, 2, NULL, 1),
(739, 'Poti sa imi oferi mai multe detalii?', '2019-07-04 06:44:09.424622', '2019-07-04 06:44:09.424622', 54, 2, 91, NULL, 0),
(740, 'Am 25 de ani, lucrez 8 ore pe zi, dorm ok, mananc ok.', '2019-07-04 06:44:09.433406', '2019-07-04 06:44:09.433406', 54, 2, 2, NULL, 1),
(741, 'Bei multe lichide?', '2019-07-04 06:44:09.441215', '2019-07-04 06:44:09.441215', 54, 2, 43, NULL, 0),
(742, 'Beau normal. Apa, doi litri pe zi.', '2019-07-04 06:44:09.449998', '2019-07-04 06:44:09.449998', 54, 2, 2, NULL, 1),
(743, 'Bei multa cafea?', '2019-07-04 06:44:09.458782', '2019-07-04 06:44:09.458782', 54, 2, 20, NULL, 0),
(744, 'Da, dar nu excesiv.', '2019-07-04 06:44:09.467566', '2019-07-04 06:44:09.467566', 54, 2, 2, NULL, 1),
(745, 'Te simti stresat la locul de munca?', '2019-07-04 06:44:09.475374', '2019-07-04 06:44:09.475374', 54, 2, 43, NULL, 0),
(746, 'Da, destul de stresat. Avem proiecte grele si termene limita foarte restranse.', '2019-07-04 06:44:09.484158', '2019-07-04 06:44:09.484158', 54, 2, 2, NULL, 1),
(747, 'Durerile de cap pot aparea deseori, insa e important sa te odihnesti si sa faci sport macar 30 de minute in fiecare zi.', '2019-07-04 06:44:09.491966', '2019-07-04 06:44:09.491966', 54, 2, 73, NULL, 0),
(748, 'Ok, multumesc mult. Sper sa fie ok.', '2019-07-04 06:44:09.500750', '2019-07-04 06:44:09.500750', 54, 2, 2, NULL, 1),
(749, 'Vrei sa iti recomand o clinica pentru un consult medical?', '2019-07-04 06:44:09.509534', '2019-07-04 06:44:09.509534', 54, 2, 63, NULL, 0),
(750, 'Nu, multumesc.', '2019-07-04 06:44:09.518318', '2019-07-04 06:44:09.518318', 54, 2, 26, NULL, 1),
(751, 'Iti pot oferi si voucher pentru clinicaxxxxx, daca te intereseaza.', '2019-07-04 06:44:09.527102', '2019-07-04 06:44:09.527102', 54, 2, 21, NULL, 0),
(752, 'Voucher? Pentru ce?', '2019-07-04 06:44:09.535887', '2019-07-04 06:44:09.535887', 54, 2, 71, NULL, 1),
(753, 'Voucherul este pentru reduceri.', '2019-07-04 06:44:09.544670', '2019-07-04 06:44:09.544670', 54, 2, 19, NULL, 0),
(754, 'Da, ok.', '2019-07-04 06:44:09.552478', '2019-07-04 06:44:09.552478', 54, 2, 61, NULL, 1),
(755, 'Poti incerca un consult medical general la clinicaxxxxx si poti folosi voucher-ul voucherxxxxx', '2019-07-04 06:44:09.560286', '2019-07-04 06:44:09.560286', 54, 2, 50, NULL, 0),
(756, 'Mersi mult.', '2019-07-04 06:44:09.569072', '2019-07-04 06:44:09.569072', 54, 2, 2, NULL, 1),
(757, 'Toate cele bune! La revedere, <NAME>!', '2019-07-04 06:44:09.577855', '2019-07-04 06:44:09.577855', 54, 2, 28, NULL, 0),
(758, 'Ma numesc <NAMEBOT>. Cu ce te pot ajuta astazi?', '2019-07-04 06:44:09.593470', '2019-07-04 06:44:09.593470', 55, 2, 1, NULL, 0),
(759, 'Am o durere puternica la coloana. Nu stiu ce am facut dar ma doare de doua zile.', '2019-07-04 06:44:09.602254', '2019-07-04 06:44:09.602254', 55, 2, 70, NULL, 1),
(760, 'Ai fost la un control pana acum, <NAME>?', '2019-07-04 06:44:09.611040', '2019-07-04 06:44:09.611040', 55, 2, 43, NULL, 0),
(761, 'Nu inca. Imi este greu sa ma deplasez.', '2019-07-04 06:44:09.620799', '2019-07-04 06:44:09.620799', 55, 2, 2, NULL, 1),
(762, 'Alte simptome ai?', '2019-07-04 06:44:09.629583', '2019-07-04 06:44:09.629583', 55, 2, 43, NULL, 0),
(763, 'Nu, insa daca ma aplec durerea este mai intensa.', '2019-07-04 06:44:09.638366', '2019-07-04 06:44:09.638366', 55, 2, 70, NULL, 1),
(764, 'Te afli sub tratament medical?', '2019-07-04 06:44:09.647150', '2019-07-04 06:44:09.647150', 55, 2, 43, NULL, 0),
(765, 'Cum adica?', '2019-07-04 06:44:09.656910', '2019-07-04 06:44:09.656910', 55, 2, 2, NULL, 1),
(766, 'Iei medicamente pentru aceasta problema?', '2019-07-04 06:44:09.665695', '2019-07-04 06:44:09.665695', 55, 2, 43, NULL, 0),
(767, 'Nu. Doar o alifie. Ma dau cand ma doare, dar nu prea ma ajuta.', '2019-07-04 06:44:09.674478', '2019-07-04 06:44:09.674478', 55, 2, 70, NULL, 1),
(768, 'Iti pot recomanda clinicaxxxxx unde te poate trata un medic specializat.', '2019-07-04 06:44:09.683262', '2019-07-04 06:44:09.683262', 55, 2, 11, NULL, 0),
(769, 'Multumesc, pot sa te mai intreb ceva?', '2019-07-04 06:44:09.692046', '2019-07-04 06:44:09.692046', 55, 2, 2, NULL, 1),
(770, 'Desigur, te ascult.', '2019-07-04 06:44:09.701806', '2019-07-04 06:44:09.701806', 55, 2, 91, NULL, 0);
INSERT INTO `conversation_editor_chatline` (`id`, `message`, `created`, `updated`, `chat_id`, `created_user_id`, `label_id`, `parent_id`, `human`) VALUES
(771, 'Exista un tratament care ma poate ajuta acum?', '2019-07-04 06:44:09.710590', '2019-07-04 06:44:09.710590', 55, 2, 52, NULL, 1),
(772, 'Numai un doctor iti poate face o recomandare potrivita.', '2019-07-04 06:44:09.719374', '2019-07-04 06:44:09.719374', 55, 2, 73, NULL, 0),
(773, 'Crezi ca e ceva foarte grav?', '2019-07-04 06:44:09.728158', '2019-07-04 06:44:09.728158', 55, 2, 2, NULL, 1),
(774, 'Nu pot pune un diagnostic, cel mai bine intrebi medicul specializat.', '2019-07-04 06:44:09.736944', '2019-07-04 06:44:09.736944', 55, 2, 2, NULL, 0),
(775, 'Bine, cand pot merge la doctor?', '2019-07-04 06:44:09.746703', '2019-07-04 06:44:09.746703', 55, 2, 2, NULL, 1),
(776, 'Orice detaliu se stabileste telefonic cu clinica recomandata.', '2019-07-04 06:44:09.757438', '2019-07-04 06:44:09.757438', 55, 2, 2, NULL, 0),
(777, 'Stii cumva cat o sa ma coste un consult?', '2019-07-04 06:44:09.766223', '2019-07-04 06:44:09.766223', 55, 2, 87, NULL, 1),
(778, 'Acesta este un detaliu stabilit la telefon la clinicaxxxxx. Recomand sa ii suni si sa folosesti un voucher pentru reducere (voucherxxxxx).', '2019-07-04 06:44:09.775982', '2019-07-04 06:44:09.775982', 55, 2, 50, NULL, 0),
(779, 'Bine, mersi', '2019-07-04 06:44:09.785742', '2019-07-04 06:44:09.785742', 55, 2, 2, NULL, 1),
(780, 'Cu multa placere, <NAME>!', '2019-07-04 06:44:09.793550', '2019-07-04 06:44:09.793550', 55, 2, 28, NULL, 0),
(781, 'Buna ziua! Ma numesc <NAMEBOT>. Cu ce informatii te pot ajuta?', '2019-07-04 06:44:09.810142', '2019-07-04 06:44:09.810142', 56, 2, 1, NULL, 0),
(782, 'Te rog, imi poti recomanda un tratament pentru migrene? Ma doare capul.', '2019-07-04 06:44:09.819902', '2019-07-04 06:44:09.819902', 56, 2, 52, NULL, 1),
(783, 'Ai luat medicamente pentru aceasta problema, <NAME>?', '2019-07-04 06:44:09.828687', '2019-07-04 06:44:09.828687', 56, 2, 43, NULL, 0),
(784, 'Nu inca. Sper sa imi poti recomanda ceva.', '2019-07-04 06:44:09.837470', '2019-07-04 06:44:09.837470', 56, 2, 2, NULL, 1),
(785, 'De cat timp ai problema aceasta?', '2019-07-04 06:44:09.846254', '2019-07-04 06:44:09.846254', 56, 2, 43, NULL, 0),
(786, 'De azi dimineata. Ma doare si nu ma lasa indiferent ce fac.', '2019-07-04 06:44:09.855039', '2019-07-04 06:44:09.855039', 56, 2, 2, NULL, 1),
(787, 'Durerea este constanta?', '2019-07-04 06:44:09.863823', '2019-07-04 06:44:09.863823', 56, 2, 43, NULL, 0),
(788, 'Nu, ba apare, ba dispare, dar nu de tot.', '2019-07-04 06:44:09.873582', '2019-07-04 06:44:09.873582', 56, 2, 2, NULL, 1),
(789, 'Mediul de lucru este stresant pentru tine?', '2019-07-04 06:44:09.882366', '2019-07-04 06:44:09.882366', 56, 2, 42, NULL, 0),
(790, 'Da, in ultima vreme am si dormit prost din cauza stresului de la serviciu. Avem niste probleme si, ma rog, e o perioada grea.', '2019-07-04 06:44:09.891150', '2019-07-04 06:44:09.891150', 56, 2, 37, NULL, 1),
(791, 'Inteleg. Ce te pot sfatui este sa mergi la clinicaxxxxx si sa faci o programare la un medic generalist.', '2019-07-04 06:44:09.900910', '2019-07-04 06:44:09.900910', 56, 2, 11, NULL, 0),
(792, 'Dar tu nu poti sa imi sugerezi un tratament?', '2019-07-04 06:44:09.909694', '2019-07-04 06:44:09.909694', 56, 2, 2, NULL, 1),
(793, 'Un specialist va fi capabil cu siguranta, in urma unui consult, sa stabileasca care este tratamentul potrivit pentru tine.', '2019-07-04 06:44:09.919454', '2019-07-04 06:44:09.919454', 56, 2, 2, NULL, 0),
(794, 'Bine dar nu vreau sa merg la doctor acum. Chiar n-am chef de spitale si clinici.', '2019-07-04 06:44:09.929215', '2019-07-04 06:44:09.929215', 56, 2, 2, NULL, 1),
(795, 'Am inteles. In acest caz iti pot recomanda sa citesti cateva articole utile de pe site-ul nostru: sitexxxxx', '2019-07-04 06:44:09.937998', '2019-07-04 06:44:09.938974', 56, 2, 12, NULL, 0),
(796, 'Aveti articole despre migrene?', '2019-07-04 06:44:09.947758', '2019-07-04 06:44:09.947758', 56, 2, 40, NULL, 1),
(797, 'Da, link-ul oferit prezinta articole legate de problema ta: sitexxxxx', '2019-07-04 06:44:09.957518', '2019-07-04 06:44:09.957518', 56, 2, 12, NULL, 0),
(798, 'Aha ok', '2019-07-04 06:44:09.967279', '2019-07-04 06:44:09.967279', 56, 2, 2, NULL, 1),
(799, 'Te mai pot ajuta cu ceva?', '2019-07-04 06:44:09.977038', '2019-07-04 06:44:09.977038', 56, 2, 72, NULL, 0),
(800, 'Nu, multumesc mult.', '2019-07-04 06:44:09.988750', '2019-07-04 06:44:09.988750', 56, 2, 2, NULL, 1),
(801, 'Cu placere! La revedere!', '2019-07-04 06:44:10.002414', '2019-07-04 06:44:10.002414', 56, 2, 28, NULL, 0),
(802, 'La revedere.', '2019-07-04 06:44:10.027791', '2019-07-04 06:44:10.027791', 56, 2, 28, NULL, 1),
(803, 'Buna ziua! Ma numesc <NAMEBOT>. Care este problema dvs?', '2019-07-04 06:44:10.058046', '2019-07-04 06:44:10.058046', 57, 2, 1, NULL, 0),
(804, 'Am o durere de cap ingrozitoare! Nu stiu ce sa fac sa imi treaca.', '2019-07-04 06:44:10.072686', '2019-07-04 06:44:10.072686', 57, 2, 52, NULL, 1),
(805, 'Ai incercat tratamente naturiste, comprese cu apa rece sau ceaiuri?', '2019-07-04 06:44:10.086352', '2019-07-04 06:44:10.087327', 57, 2, 43, NULL, 0),
(806, 'Nu. Nu suport ceaiurile.', '2019-07-04 06:44:10.100014', '2019-07-04 06:44:10.100014', 57, 2, 2, NULL, 1),
(807, 'De cat timp ai aceasta durere?', '2019-07-04 06:44:10.113679', '2019-07-04 06:44:10.113679', 57, 2, 43, NULL, 0),
(808, 'De o ora.', '2019-07-04 06:44:10.125390', '2019-07-04 06:44:10.125390', 57, 2, 2, NULL, 1),
(809, 'Este o durere constanta sau intermitenta?', '2019-07-04 06:44:10.136126', '2019-07-04 06:44:10.136126', 57, 2, 43, NULL, 0),
