(1831, 'Buna. Nu stiu de ce dar nu mai am vlaga. Am o stare neplacuta si imi este greu sa fac ceva.', '2019-07-04 06:44:20.351909', '2019-07-04 06:44:20.351909', 101, 2, 37, NULL, 1),
